        [Fact]
        public void CanWriteFormatTypes()
        {
            // Assign
            var variables = new List<Variable>
            {
                new Variable<string>("var1", 9),
                new Variable<double>("var2", 7, 3),
                new Variable<DateTime>("var4", 20)
            };
            var row1 = new List<object?> { "string", 15.5, new DateTime(2020, 1, 1) };
            var row2 = new List<object?> { null, null, null };
            var rows = new List<List<object?>> { row1, row2 };
            var ms = new MemoryStream();

            // Act
            SpssWriter.Write(variables, rows, ms);

            // Assert
            ms.Position = 0;
            var spssData2 = SpssReader.Read(ms);
            var result = JsonSerializer.Serialize(spssData2).Replace("\"", "'");
            Assert.Equal(FormatTypes.Replace(Environment.NewLine, ""), result);
        }

        [Fact]
