                new Variable<DateTime>("var4", 20)
                    { Label = "label for var4", ValueLabels = new Dictionary<DateTime, string> { [new DateTime(2020, 1, 2)] = "valueLabel for 2 jan 2020", [new DateTime(2020, 1, 1)] = "valueLabel for 1 jan 2020" } }
