            using var ms = new MemoryStream();
            var spss = new SpssWriter(variables, ms);
            spss.MetadataWriter.Write();
            spss.DataWriter.Write("v1");
            spss.DataWriter.Write(1d);
            spss.DataWriter.Write(new DateTime(2020, 1, 1));
            spss.DataWriter.Write("v2");
            spss.DataWriter.Write(1d);
