            SaveToFile(ms, "Custom1");
            ms.Position = 0;
            var spssData = SpssReader.Read(ms);
            var result = JsonSerializer.Serialize(spssData).Replace("\"", "'");
            Assert.Equal(Custom1.Replace(Environment.NewLine, ""), result);
        }

